import React from "react";

const Register = () => {
  return (
    <div className="registerMainDiv">
      <form className="registerForm">
        {[
          "name",
          "lastname",
          "username",
          "email",
          "password",
          "repeat password",
        ].map((item, index) => {
          if (item === "password" || item === "repeat password") {
            return (
              <input
                type="password"
                name={item}
                placeholder={item}
                key={index}
                className="registerFormInput"
              ></input>
            );
          }
          return (
            <input
              type="text"
              name={item}
              placeholder={item}
              key={index}
              className="registerFormInput"
            ></input>
          );
        })}
        <button className="submitButton" style={{ width: "auto" }}>
          Submit
        </button>
      </form>
    </div>
  );
};

export default Register;
